import styleHeader from "./header.module.css";
import { NavLink, useNavigate } from "react-router-dom";
export default function Header() {
  const navigate = useNavigate();
  function handleClick() {
    navigate("/player1");
  }
  return (
    <>
      <header
        style={{
          background: "#09203F",
          height: "20vh",
          display: "flex",
          flexDirection: "row",
        }}
      >
        {/* <button className={styleHeader.button} onClick={handleClick}>
          Back
        </button> */}
        <NavLink to="/player1" className={styleHeader.button}>
          Player 1
        </NavLink>
        <image src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.pinterest.com%2Fpin%2F717768062982013%2F&psig=AOvVaw3" />
        <h1
          style={{
            textAlign: "center",
            padding: "2rem 0rem",
            color: "#f1f4ffff",
            margin: "0rem 0rem 12rem 31.5rem",
          }}
        >
          GUESS THE NAME
        </h1>
      </header>
    </>
  );
}
